# coding=utf8
import re
import json
# importo el archivos html con la tabla
with open('index.html', 'r') as file:
    f = file.read()

def __minify(string):
	regex = r"(\n|\t|\s(?=\s+))"
	regex_2 = r"(?<=\>)(\s+?)(?=\<)"
	# Remueve los comentarios
	comments = r"(\<\!--([\s\S]*?)--\>)"
	subst = ""

	result = re.sub(regex, subst, string, 0)
	result = re.sub(regex_2, subst, result, 0)
	result = re.sub(comments, subst, result, 0)
	return result

rgx_prev = r"^([\s\S]*?)(?=<tr>)"
regex = r"(?:<tr[^>]*>(?:[\s\S]*?)<td[^>]*>(?P<code>[\s\S]*?)<\/td>(?:[\s\S]*?)<td[^>]*>(?P<provincia>[\s\S]*?)<\/td>(?:[\s\S]*?)<b[^>]*>(?P<cabecera>[\s\S]*?)<\/b>,?(?P<localidades>[\S\s]*?)<\/td>(?:[\s\S]*?)<\/tr>)"
rgx_ceaner = r"(\n|\\n|<br>|<br\s?\/>)"
rgx_final = r"(?=<\/table>)([\s\S]*)"

subst = "{\"area_code\":\\1,\"province\":\"\\2\",\"city\":\"\\3\",\"localidades\":\"\\4\"},"

result = re.sub(rgx_prev, '', str(f), 0)
result = re.sub(regex, subst, result, 0)
result = re.sub(rgx_ceaner, '', result, 0)
result = re.sub(rgx_final, '', result, 0)


if result:
    s = open('test.txt', 'w')
    s.write(__minify(result))
    s.close()



